import logo from './logo.svg';
import './App.css';

import MainBrowserRouter from "./Routing/MainBrowserRouter";
function App() {
  return (

      <MainBrowserRouter>
          <div className="App">


              {/*<LoginButton/>*/}


              <h1>TEST LOGIN</h1>
              <form>
                  <input type={"text"} placeholder={"email"}/>
              </form>


              <header className="App-header">
                  <img src={logo} className="App-logo" alt="logo" />
                  <p>
                      Edit <code>src/App.js</code> and save to reload.
                  </p>
                  <a
                      className="App-link"
                      href="https://reactjs.org"
                      target="_blank"
                      rel="noopener noreferrer"
                  >
                      Learn React
                  </a>
              </header>
          </div>
      </MainBrowserRouter>


  );
}

export default App;
